// ==UserScript==
// @name         AutoPLay Shorts
// @author       Alimsoftware
// @namespace    https://raw.githubusercontent.com/Alimsoftware/ScriptsTM/refs/heads/main/AutoPlayShorts.js
// @version      1.0
// @description  YouTube Shorts autosplays next video after a video finished
// @match        *://www.youtube.com/*
// @run-at       document-ready
// @downloadURL  https://raw.githubusercontent.com/Alimsoftware/ScriptsTM/refs/heads/main/AutoPlayShorts.js
// @updateURL    https://raw.githubusercontent.com/Alimsoftware/ScriptsTM/refs/heads/main/AutoPlayShorts.js
// @homepageURL  https://github.com/Alimsoftware/ScriptsTM
// @icon         data:image/png;base64,
// @grant        none
// ==/UserScript==



(function() {
    'use strict';

    const MAX_RETRY_FINDING_LOCATOR = 15;
    const NO_UPDATE_TIMEOUT = 3000; // Timeout in milliseconds (configurable)

    async function moveToNextVideo() {
        const progress = await getElement('.YtPlayerProgressBarDragContainer');
        checkProgress(progress);
    }

    async function checkProgress(progress) {
        if (progress == null) return;

        let previousProgressPercent = 0;
        let currentProgressPercent = 0;
        let noUpdateTimeoutId = null;

        var observer = new MutationObserver(async function (mutations) {
            mutations.forEach(async function (mutation) {
                if (mutation.type === 'attributes') {
                    currentProgressPercent = mutation.target.attributes['aria-valuenow'].value;

                    // Reset the inactivity timeout whenever a mutation occurs
                    resetNoUpdateTimeout();

                    // Check progress and determine whether to move to the next video
                    if (currentProgressPercent > 98 || parseInt(previousProgressPercent) > currentProgressPercent) {
                        previousProgressPercent = 0;
                        document.querySelector('.navigation-container #navigation-button-down button').click();
                        observer.disconnect();
                        clearNoUpdateTimeout(); // Clear timeout on successful navigation
                        await sleep(3500);
                        const activeProgress = await getElement('.YtPlayerProgressBarDragContainer');
                        checkProgress(activeProgress);
                    } else {
                        previousProgressPercent = currentProgressPercent;
                    }
                }
            });
        });

        observer.observe(progress, {
            attributes: true,
        });

        // Function to reset the inactivity timer
        function resetNoUpdateTimeout() {
            clearNoUpdateTimeout();
            noUpdateTimeoutId = setTimeout(() => {
                console.log('No updates in the last 3 seconds. Moving to the next video...');
                observer.disconnect(); // Disconnect the observer
                moveToNextVideo(); // Call the moveToNextVideo function
            }, NO_UPDATE_TIMEOUT);
        }

        // Function to clear the inactivity timeout
        function clearNoUpdateTimeout() {
            if (noUpdateTimeoutId) {
                clearTimeout(noUpdateTimeoutId);
                noUpdateTimeoutId = null;
            }
        }

        // Initialize the timeout for the first time
        resetNoUpdateTimeout();
    }

    function sleep(ms) {
        return new Promise((resolve) => setTimeout(resolve, ms));
    }

    async function getElement(locator) {
        let retryTime = 0;
        let element;
        while (!element && retryTime < MAX_RETRY_FINDING_LOCATOR) {
            await sleep(500);
            console.log(`Finding ${locator} ${retryTime++}`);
            element = document.querySelector(locator);
        }
        return element;
    }

    if (location.href.includes('https://www.youtube.com/shorts')) {
        console.log(location.href);
        moveToNextVideo();
    }

})();
